$templateCache.put("docs/node_modules/weinre/web/doc/Building.html","<!doctype html><html><head><title>weinre - Building</title><link rel=stylesheet href=css/main.css type=text/css><link rel=\"shortcut icon\" href=images/weinre-icon-64x64.png></head><body><div class=ribbon>clone weinre at <a href=\"https://git-wip-us.apache.org/repos/asf?p=cordova-weinre.git\">apache</a></div><h1 class=page-title>weinre - Building</h1><div class=toc><a href=Home.html>Home</a> - <a href=UserInterface.html>User Interface</a> - <a href=Installing.html>Installing</a> - <a href=Running.html>Running</a> - <a href=MultiUser.html>Multi-User</a> - <a href=Security.html>Security</a> - <a href=Building.html>Building</a> - <a href=ChangeLog.html>ChangeLog</a> - <a href=License.html>License</a><p>~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~</p></div><p>The source repository for weinre is maintained at Apache. See the archives information on the <a href=Installing.html>Installing</a> page for more information on downloading a source archive.</p><p>If you\'d prefer to obtain the source via git, you can use one of the following repos:<ul><li>Apache repo:<td><a href=https://git-wip-us.apache.org/repos/asf/cordova-weinre.git>https://git-wip-us.apache.org/repos/asf/cordova-weinre.git</a><li>GitHub repo:<td><a href=https://github.com/apache/cordova-weinre>https://github.com/apache/cordova-weinre</a></td></li></td></li></ul></p><p>The Apache repo is the canonical repo. The url can be used in a web browser, or as the argument of a<tt>git clone</tt>command.</p><p>The GitHub repo is a clone of the Apache repo, and automatically shadowed at some regular interval. The url is the web view of the repo, from which you can obtain a url to use with<tt>git clone</tt>.</p><p>See the file<tt><a href=\"https://git-wip-us.apache.org/repos/asf?p=cordova-weinre.git;a=blob;f=README.md;hb=HEAD\">README.md<a></a></a></tt>in the top-most directory of the source distribution for more instructions on how to perform a build. A <a href=https://github.com/apache/cordova-weinre/blob/master/README.md>markdown-processed version of the README file is available on GitHub</a>.<div class=toc>~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~<p><a href=Home.html>Home</a> - <a href=UserInterface.html>User Interface</a> - <a href=Installing.html>Installing</a> - <a href=Running.html>Running</a> - <a href=MultiUser.html>Multi-User</a> - <a href=Security.html>Security</a> - <a href=Building.html>Building</a> - <a href=ChangeLog.html>ChangeLog</a> - <a href=License.html>License</a><br><img src=images/weinre-icon-128x128.png></p></div></p></body></html>");
$templateCache.put("docs/node_modules/weinre/web/doc/ChangeLog.html","<!doctype html><html><head><title>weinre - ChangeLog</title><link rel=stylesheet href=css/main.css type=text/css><link rel=\"shortcut icon\" href=images/weinre-icon-64x64.png></head><body><div class=ribbon>clone weinre at <a href=\"https://git-wip-us.apache.org/repos/asf?p=cordova-weinre.git\">apache</a></div><h1 class=page-title>weinre - ChangeLog</h1><div class=toc><a href=Home.html>Home</a> - <a href=UserInterface.html>User Interface</a> - <a href=Installing.html>Installing</a> - <a href=Running.html>Running</a> - <a href=MultiUser.html>Multi-User</a> - <a href=Security.html>Security</a> - <a href=Building.html>Building</a> - <a href=ChangeLog.html>ChangeLog</a> - <a href=License.html>License</a><p>~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~</p></div><h2>2012/??/?? - version 2.0.0</h2><ul><li><p>port the server from Java to node.js<li><p>lots of other changes</p></li></p></li></ul><p>issues resolved:<ul><li><a href=https://issues.apache.org/jira/browse/CB-10>CB-10</a> - Apache source headers in callback-weinre</li><li><a href=https://issues.apache.org/jira/browse/CB-36>CB-36</a> - move/delete GitHub issues at phonegap/weinre and callback/callback-weinre into the Apache Callback JIRA</li><li><a href=https://issues.apache.org/jira/browse/CB-83>CB-83</a> - implement the server in node</li><li><a href=https://issues.apache.org/jira/browse/CB-100>CB-100</a> - fix issues regarding pre-req licenses for weinre distribution</li><li><a href=https://issues.apache.org/jira/browse/CB-175>CB-175</a> - error when XHR contentType is null</li><li><a href=https://issues.apache.org/jira/browse/CB-176>CB-176</a> - add vendor files to weinre instead of pulling in at build time</li><li><a href=https://issues.apache.org/jira/browse/CB-182>CB-182</a> - error when XHR contentType is null</li><li><a href=https://issues.apache.org/jira/browse/CB-232>CB-232</a> - rename assets from PhoneGap to Cordova</li><li><a href=https://issues.apache.org/jira/browse/CB-257>CB-257</a> - the README.md in the weinre-node distribution is bogus</li><li><a href=https://issues.apache.org/jira/browse/CB-259>CB-259</a> - create a weinre tarball as a build archive that is npm install-able</li><li><a href=https://issues.apache.org/jira/browse/CB-266>CB-266</a> - weinre runtime error if you don\'t have a ~/.weinre/server.settings file</li><li><a href=https://issues.apache.org/jira/browse/CB-284>CB-284</a> - invocation exception on WeinreClientEventsImpl.connectionCreated(): TypeError: Cannot read property \'url\' of undefined</li><li><a href=https://issues.apache.org/jira/browse/CB-288>CB-288</a> - re-version as 2.0.0</li><li><a href=https://issues.apache.org/jira/browse/CB-293>CB-293</a> - bullet-proof modjewel</li><li><a href=https://issues.apache.org/jira/browse/CB-294>CB-294</a> - various exceptions thrown in the target in WeinreTargetEventsImpl.connectionCreated()</li><li><a href=https://issues.apache.org/jira/browse/CB-315>CB-315</a> - generate valid Apache release artifact names</li><li><a href=https://issues.apache.org/jira/browse/CB-540>CB-540</a> - ability to easily navigate to particular place in DOM via bookmarks/jump to selector</li><li><a href=https://issues.apache.org/jira/browse/CB-604>CB-604</a> - weinre doesn\'t work in strict mode</li><li><a href=https://issues.apache.org/jira/browse/CB-873>CB-873</a> - setTimeout() and setInterval() usage with string arguments is busted</li><li><a href=https://issues.apache.org/jira/browse/CB-984>CB-984</a> - cannot install weinre with Node 0.8.0</li><li><a href=https://issues.apache.org/jira/browse/CB-1666>CB-1666</a> - \"INVALID_STATE_ERR: DOM Exception 11\" with chbrody/Cordova-SQLitePlugin</li><li><a href=https://issues.apache.org/jira/browse/CB-1759>CB-1759</a> - doc indicates that you should launch weinre with a command prefix of `node`</li><li><a href=https://issues.apache.org/jira/browse/CB-1193>CB-1193</a> - add Windows Phone support</li><li><a href=https://issues.apache.org/jira/browse/CB-1800>CB-1800</a> - remove references to \"incubator\"</li><li><a href=https://issues.apache.org/jira/browse/CB-1494>CB-1494</a> - Supports running server behind a proxy, such as Heroku Cedar</li><li><a href=https://issues.apache.org/jira/browse/CB-2650>CB-2650</a> - Weinre style inspection breaks with normalize.css</li><li><a href=https://issues.apache.org/jira/browse/CB-3319>CB-3319</a> - Chrome is setting window properties which now breaks Weinre</li><li><a href=https://issues.apache.org/jira/browse/CB-3328>CB-3328</a> - chrome version >= 27 breaks flex-box usage</li><li><a href=https://issues.apache.org/jira/browse/CB-3378>CB-3378</a> - support for FF and IE10</li><li><a href=https://issues.apache.org/jira/browse/CB-6991>CB-6991</a> - Weinre fails to load in browsers without a built-in development console</li><li><a href=https://issues.apache.org/jira/browse/CB-7367>CB-7367</a> - allow update of weinre id in page url without page refresh</li><li><a href=https://issues.apache.org/jira/browse/CB-7430>CB-7430</a> - weinre does not play nice with npm dedupe</li><li><a href=https://issues.apache.org/jira/browse/CB-7437>CB-7437</a> - xhr readystate event passed bad event on some platforms</li><li><a href=https://issues.apache.org/jira/browse/CB-7438>CB-7438</a> - weinre target not setting server url when from script\'s src attribute for https</li><li><a href=https://issues.apache.org/jira/browse/CB-5718>CB-5718</a> - Detection of HTTPS broken</li></ul></p><h2>2011/12/01 - version 1.6.1</h2><ul><li><p>Error handling for some built-in callbacks has been removed. This function was added in version 1.6.0. Unfortunately, it had some problems, and it wasn\'t clear if the fix was going to make things worse.</p></li></ul><p>issues resolved:<ul><li><a href=https://issues.apache.org/jira/browse/CB-82>apache/callback issue 82</a> - removeEventListener broken</li></ul></p><h2>2011/10/28 - version 1.6.0</h2><ul><li><p>The Network panel has been added to weinre, which will display information for any XHRs that you issue.<li><p>Error handling for some built-in callbacks has been added. The support is very similar to what\'s provided in the <a href=https://github.com/pmuellr/log-callback-error>log-callback-error project</a>, though the implementation is different.<li><p>The element highlighter has been modified to show brighter colors. The colors also now more closely match the Web Inspector colors. Currently, there are some artifacts in the corners in some cases, but it\'s not clear to me this is a huge problem - in fact, maybe it\'s a feachur. ~shrug~ As part of this clean up, I\'ve made the element highlighter pluggable. If you think you can do better, it should be pretty straight-forward to code up a new one. Bring it on.<li><p>The JavaScript code for weinre has been converted from the \"scoop\" DSL format to CoffeeScript. You no longer have a valid excuse for not hacking the code.<li><p>The \"Test Drive\" page of the doc has been removed and replaced with the new \"User Interface\" page.<li><p>weinre now adds an \"error\" listener to window. For JavaScript engines that support \"window onerror\", you will now see a message logged to the console when an error occurs anywhere in your JavaScript code. Unfortunately, just as support for \"window onerror\" is becoming available in JavaScript, the browsers are neutering it\'s support. Depending on your browser, you may or may not see these errors reported, and even if you do, they may not give you <b>any</b> useful information. Thanks to Ryan Seddon for supplying the following backgrounder links for your enjoyment:<ul><li><a href=http://lists.whatwg.org/htdig.cgi/whatwg-whatwg.org/2011-September/033252.html>http://lists.whatwg.org/htdig.cgi/whatwg-whatwg.org/2011-September/033252.html</a></li><li><a href=\"https://bugzilla.mozilla.org/show_bug.cgi?id=568564\">https://bugzilla.mozilla.org/show_bug.cgi?id=568564</a></li><li><a href=\"http://www.w3.org/Bugs/Public/show_bug.cgi?id=14177\">http://www.w3.org/Bugs/Public/show_bug.cgi?id=14177</a></li><li><a href=\"https://bugs.webkit.org/show_bug.cgi?id=70574\">https://bugs.webkit.org/show_bug.cgi?id=70574</a></li></ul></p></li></p></li></p></li></p></li></p></li></p></li></ul><p>issues resolved:<ul><li><a href=https://issues.apache.org/jira/browse/CB-1>issue apache/callback issue 1</a> - update the doc</li><li><a href=https://github.com/phonegap/weinre/issues/41>issue phonegap/weinre 41</a> - add support for XHRs on Network panel</li><li><a href=https://github.com/phonegap/weinre/issues/40>issue phonegap/weinre 40</a> - clean up spurious messages in the server console</li><li><a href=https://github.com/phonegap/weinre/issues/38>issue phonegap/weinre 38</a> - cleanup some of the exception handler bits</li><li><a href=https://github.com/phonegap/weinre/issues/37>issue phonegap/weinre 37</a> - Timeout function does not pass arguments</li><li><a href=https://github.com/phonegap/weinre/issues/35>issue phonegap/weinre 35</a> - convert JavaScript in weinre from scoop to CoffeeScript</li><li><a href=https://github.com/phonegap/weinre/issues/20>issue phonegap/weinre 20</a> - add support for window.onerror</li><li><a href=https://github.com/phonegap/weinre/issues/19>issue phonegap/weinre 19</a> - 404 error on /client/index.html in Mac app (incomplete build?)</li><li><a href=https://github.com/phonegap/weinre/issues/11>issue phonegap/weinre 11</a> - provide better error handling - by hook or by crook</li><li><a href=https://github.com/phonegap/weinre/issues/10>issue phonegap/weinre 10</a> - element highlighter code in the target is just awful</li></ul></p><h2>2011/07/22 - version 1.5.0</h2><ul><li><p>The Resources panel now includes an active Databases section. For any WebSQL database that you open, you should see an entry in the expanded section. For each database, you\'ll see the list of tables owned by the database when the database section is expanded. Note that you need to open the database to see it listed here. Databases which you have previously created in other browsing sessions will not be displayed until they are first opened.</p><p>Clicking on a database table will dump the database contents to the panel. Clicking on the database itself will provide a prompter for you to run SQL commands against that database. For example, entering<tt>\"select * from YourTableNameHere\"</tt>will dump the table contents to the panel.<li><p>Some of the console functions, like<tt>console.log()</tt>, were not handling object arguments correctly. You should now see a an object display. For example, typing<tt>\"window\"</tt>or<tt>\"console.log(window)\"</tt>into the console will show you the same object display for the window.<li><p>The ant build script did not have the correctly-cased file names for some of the files, and the build failed. This has been fixed. You should be able to do a build on Linux, and other case-sensitive file systems.<li><p>While weinre already removes some of the Web Inspector panels wholesale, there were still a number of meaningless gee-gaws on the panels that we do show. Those have been surgically removed with CSS.</p></li></p></li></p></li></p></li></ul><p>issues closed:<ul><li><a href=https://github.com/phonegap/weinre/issues/7>issue 7</a> - support for WebSQL</li><li><a href=https://github.com/phonegap/weinre/issues/8>issue 8</a> - console.log() etal don\'t handle object parameters</li><li><a href=https://github.com/phonegap/weinre/issues/12>issue 12</a> - wrong-cased file names in ant scripts for Linux</li><li><a href=https://github.com/phonegap/weinre/issues/16>issue 16</a> - hide stuff in the Web Inspector UI that\'s not used</li></ul></p><h2>2011/05/09 - version 1.4.0</h2><ul><li>better calculation of object\'s class name. closes <a href=https://github.com/pmuellr/weinre/issues/41>issue 41</a>.</li><li>initial set of changes in for extensions. closes <a href=https://github.com/pmuellr/weinre/issues/8>issue 8</a>.</li><li>added json2.js to the mix; part of issue <a href=https://github.com/pmuellr/weinre/issues/45>issue 45</a>.</li><li>works with recent scooj release. closes <a href=https://github.com/pmuellr/weinre/issues/52>issue 52</a>.</li><li>add non-authenticated multi-user support. closes <a href=https://github.com/pmuellr/weinre/issues/50>issue 50</a>. See <a href=MultiUser.html>the MultiUser doc page</a> for more information.</li></ul><p>issues closed:<ul><li><a href=https://github.com/pmuellr/weinre/issues/8>issue 8</a> - enable extensions</li><li><a href=https://github.com/pmuellr/weinre/issues/41>issue 41</a> - in JSC, inspected object\'s class is always \"object\"</li><li><a href=https://github.com/pmuellr/weinre/issues/50>issue 50</a> - add non-authenticated multi-user support</li><li><a href=https://github.com/pmuellr/weinre/issues/52>issue 52</a> - react to recent modjewel / scooj changes</li></ul></p><h2>2011/04/05 - version 1.3.0</h2><ul><li>style editing now enabled in Elements panel</li><li>localStorage and sessionStorage views enabled in Resources panel</li><li>URLs to vendor repos updated for the weinre build</li><li>check for bad versions of Prototype.js</li></ul><p>issues closed:<ul><li><a href=https://github.com/pmuellr/weinre/issues/21>issue 21</a> - add support for localStorage</li><li><a href=https://github.com/pmuellr/weinre/issues/35>issue 35</a> - testing local files on IOS</li><li><a href=https://github.com/pmuellr/weinre/issues/36>issue 36</a> - element.style cannot be edited</li><li><a href=https://github.com/pmuellr/weinre/issues/44>issue 44</a> - update vendor repos</li></ul></p><h2>2011/03/12 - version 1.2.0</h2><ul><li>DOM elements are now updated live as they change in the target</li><li>more console support; sprintf formatting and expandable object logging</li></ul><p>issues closed:<ul><li><a href=https://github.com/pmuellr/weinre/issues/27>issue 27</a> - edge case where programmatically created DOM is only picked up partially</li><li><a href=https://github.com/pmuellr/weinre/issues/37>issue 37</a> - console.log output doesn\'t do sprintf-style string interpolations</li></ul></p><h2>2011/03/02 - version 1.1.0</h2><ul><li>added Timeline panel; tracks timers, intervals, XHRs, some other events, and<tt>console.markTimeline(<i>string</i>)</tt></li><li>now showing matching style rules in Elements panel</li><li>no more diagnostic messages in the user\'s console; they are now written to the server console</li><li>caught up to a more recent version of Web Inspector</li><li>refactoring, technical debt paydown</li></ul><p>issues closed:<ul><li><a href=https://github.com/pmuellr/weinre/issues/10>issue 10</a> - enable Timeline panel, and provide some events</li><li><a href=https://github.com/pmuellr/weinre/issues/20>issue 20</a> - catch up to latest Web Inspector code base</li><li><a href=https://github.com/pmuellr/weinre/issues/23>issue 23</a> - mac app\'s web pages can\'t connect to server</li><li><a href=https://github.com/pmuellr/weinre/issues/24>issue 24</a> - weinre server runs slowly on windows</li><li><a href=https://github.com/pmuellr/weinre/issues/25>issue 25</a> - pay down technical debt</li><li><a href=https://github.com/pmuellr/weinre/issues/28>issue 28</a> - create a standalone Java launch</li><li><a href=https://github.com/pmuellr/weinre/issues/29>issue 29</a> - autoconnect does not always work</li><li><a href=https://github.com/pmuellr/weinre/issues/30>issue 30</a> - all-json-idls.js is a pig</li><li><a href=https://github.com/pmuellr/weinre/issues/31>issue 31</a> - redirect error/warn/info/debug messages from client and target to server</li><li><a href=https://github.com/pmuellr/weinre/issues/32>issue 32</a> - monospace font too small everywhere</li><li><a href=https://github.com/pmuellr/weinre/issues/33>issue 33</a> - update doc</li></ul></p><h2>2011/01/25 - version 1.0.0</h2><ul><li>Don\'t display \"not implemented\" messages. Closes <a href=https://github.com/pmuellr/weinre/issues/1>issue 19</a>.</li><li>Remove node highlighting cruft. Closes <a href=https://github.com/pmuellr/weinre/issues/1>issue 18</a>.</li><li>Add meta element to enable GCF for client. Closes <a href=https://github.com/pmuellr/weinre/issues/1>issue 17</a>.</li><li>Make bookmarklet more portable. Closes <a href=https://github.com/pmuellr/weinre/issues/1>issue 16</a>.</li><li>Enable node highlighting. Closes <a href=https://github.com/pmuellr/weinre/issues/1>issue 2</a>.</li><li>Change copyright statements. Closes <a href=https://github.com/pmuellr/weinre/issues/1>issue 13</a>.</li><li>Change Weinre.Console to Console. Closes <a href=https://github.com/pmuellr/weinre/issues/1>issue 11</a>.</li><li>Add implementation for settings. Closes <a href=https://github.com/pmuellr/weinre/issues/1>issue 5</a>.</li><li>Provide better escape for // comments in minifier. Closes <a href=https://github.com/pmuellr/weinre/issues/1>issue 6</a>.</li><li>Get metrics working in Elements panel. Closes <a href=https://github.com/pmuellr/weinre/issues/1>issue 1</a>.</li></ul><h2>2010/12/16 - version 0.9.9</h2><ul><li>initial release</li></ul><div class=toc>~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~<p><a href=Home.html>Home</a> - <a href=UserInterface.html>User Interface</a> - <a href=Installing.html>Installing</a> - <a href=Running.html>Running</a> - <a href=MultiUser.html>Multi-User</a> - <a href=Security.html>Security</a> - <a href=Building.html>Building</a> - <a href=ChangeLog.html>ChangeLog</a> - <a href=License.html>License</a><br><img src=images/weinre-icon-128x128.png></p></div></body></html>");
$templateCache.put("docs/node_modules/weinre/web/doc/Home.html","<!doctype html><html><head><title>weinre - Home</title><link rel=stylesheet href=css/main.css type=text/css><link rel=\"shortcut icon\" href=images/weinre-icon-64x64.png></head><body><div class=ribbon>clone weinre at <a href=\"https://git-wip-us.apache.org/repos/asf?p=cordova-weinre.git\">apache</a></div><h1 class=page-title>weinre - Home</h1><div class=toc><a href=Home.html>Home</a> - <a href=UserInterface.html>User Interface</a> - <a href=Installing.html>Installing</a> - <a href=Running.html>Running</a> - <a href=MultiUser.html>Multi-User</a> - <a href=Security.html>Security</a> - <a href=Building.html>Building</a> - <a href=ChangeLog.html>ChangeLog</a> - <a href=License.html>License</a><p>~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~</p></div><p><span class=weinre>weinre</span> is <b>WE</b>b <b>IN</b>spector <b>RE</b>mote. Pronounced like the word \"winery\". Or maybe like the word \"weiner\". Who knows, really.</p><p><span class=weinre>weinre</span> is a debugger for web pages, like FireBug (for FireFox) and Web Inspector (for WebKit-based browsers), except it\'s designed to work <b>remotely</b>, and in particular, to <b>allow you debug web pages on a mobile device such as a phone</b>.</p><p>Interesting places to visit:<table><tr><td>videos at YouTube:</td><td><a href=\"http://www.youtube.com/results?search_query=weinre\">http://www.youtube.com/results?search_query=weinre</a></td></tr><tr><td>this documentation:</td><td><a href=\"http://people.apache.org/~pmuellr/weinre/\">http://people.apache.org/~pmuellr/weinre/</a> [temporary]</td></tr><tr><td>unofficial binary packages:</td><td><a href=\"http://people.apache.org/~pmuellr/weinre/\">http://people.apache.org/~pmuellr/weinre/</a> [temporary]</td></tr><tr><td>issues:</td><td><a href=\"https://issues.apache.org/jira/secure/IssueNavigator.jspa?jqlQuery=project=CB+and+component=weinre\">https://issues.apache.org/jira/gobble-de-gook/...</a></td></tr><tr><td>create a new issue:</td><td><a href=\"https://issues.apache.org/jira/secure/CreateIssueDetails!init.jspa?pid=12312420&components=12316604&issuetype=1\">bug</a> or <a href=\"https://issues.apache.org/jira/secure/CreateIssueDetails!init.jspa?pid=12312420&components=12316604&issuetype=2\">new feature</a></td></tr><tr><td>cloneable source at Apache:</td><td><a href=https://git-wip-us.apache.org/repos/asf/cordova-weinre.git>https://git-wip-us.apache.org/repos/asf/cordova-weinre.git</a></td></tr><tr><td>Apache repo cloned at GitHub:</td><td><a href=https://github.com/apache/cordova-weinre>https://github.com/apache/cordova-weinre</a></td></tr><tr><td>mailing lists at Apache:</td><td><a href=\"http://mail-archives.apache.org/mod_mbox/cordova-dev/\">http://mail-archives.apache.org/mod_mbox/cordova-dev/</a> (for weinre development)</td></tr><tr><td>discussion at Google Group:</td><td><a href=http://groups.google.com/group/weinre>http://groups.google.com/group/weinre</a> (for weinre usage)</td></tr></table></p><p>More information on <span class=weinre>weinre</span>\'s big brothers, Web Inspector / Google Chrome Developer Tools, is available at <a href=http://code.google.com/chrome/devtools/docs/overview.html>Google\'s Chrome Dev Tools pages</a> and <a href=http://developer.apple.com/library/safari/#documentation/appleapplications/Conceptual/Safari_Developer_Guide/DebuggingYourWebsite/DebuggingYourWebsite.html>Apple\'s Web Inspector pages</a>.</p><p>If you aren\'t familiar with FireBug or Web Inspector, <span class=weinre>weinre</span> isn\'t going to make too much sense to you. <span class=weinre>weinre</span> reuses the user interface code from the <a href=http://trac.webkit.org/wiki/WebInspector>Web Inspector project at WebKit</a>, so if you\'ve used Safari\'s Web Inspector or Chrome\'s Developer Tools, <span class=weinre>weinre</span> will be very familiar. If you\'re not familiar with Web Inspector, the links above to Google\'s and Apple\'s documentation will be useful.</p><p>Here\'s an example session using <span class=weinre>weinre</span>:</p><p><img src=images/weinre-demo.jpg></p><p>Two screen captures are shown above. On the left is the <span class=weinre>weinre</span> <b>client</b> application, displaying debug information. On the right is the <b>target</b> web page, running in Mobile Safari in the iOS Simulator.</p><p>In normal usage, you will be running the <b>client</b> application in a browser on your desktop/laptop, and running a <b>target</b> web page on your mobile device.</p><p>In the session above, the debugger is display the Elements panel, with the embedded console expanded in the bottom third of the window. In the console area, we\'ve entered two statements:<pre>\ndocument.body.style.backgroundColor\ndocument.body.style.backgroundColor = \"pink\"\n</pre></p><p>The result of running the first statement shows the value of the body\'s background style is not set. The second statement sets the body\'s background to pink. That horrifying pink background is then rendered in the <b>target</b>\'s window.</p><p>In addition, an<tt>h1</tt>element is selected in the upper third of the Elements panel, which causes the side panels on the right to be filled in with relevant information. In this case, the matched CSS rules for that<tt>h1</tt>element are being shown.</p><p>If you are familiar with WebKit\'s Web Inspector, a partial list of differences between it and <span class=weinre>weinre</span> are listed below:<ul class=spaced><li><span class=weinre>weinre</span> does not make use of any \'native\' code in the browser, it\'s all plain old boring JavaScript.</li><li>Because <span class=weinre>weinre</span> doesn\'t use \'native\' code, it\'s functionality is limited. For instance, source level debug of JavaScript is not <span class=strike>possible</span> <a href=\"http://lexandera.com/aardwolf/\">easy</a>.</li><li>Because <span class=weinre>weinre</span> doesn\'t use \'native\' code, the debug target code will run on browsers without specialized debug support. For instance, a browser running on your phone.</li><li><span class=weinre>weinre</span> supports \'remote\' interaction, so you can run the debugger user interface on one machine and can debug a web page running on another machine. For instance, debug a web page displayed on your phone from your laptop.</li><li>Because <span class=weinre>weinre</span> supports \'remote\' interaction, multiple debug clients can be debugging the same debug target at the same time.</li><li>One thing <b>not</b> different from Web Inspector is that the debug client user interface only runs on WebKit-based browsers.</li></ul></p><h2>Supported Libraries and Platforms</h2><p>Generally version numbers listed here are the earliest versions of the relevant thing that have been tested. Later versions of those things are also hopefully supported, but let us know.</p><h3>Libraries not supported</h3><ul><li>versions of Prototype.js before version 1.7 are not supported, as they do not support the<tt>JSON.stringify()</tt>API correctly. You will get an<tt>alert()</tt>in the web page you are debugging if you attempt to debug it with <span class=weinre>weinre</span> and you are using an unsupported version of Prototype.js.</li></ul><h3>Platforms supported - debug server</h3><p>Any platform that supports <a href=\"http://nodejs.org/\">node.js</a>.</p><h3>Platforms supported - debug client</h3><p>The browser where the debugger user interface runs.<ul><li>Google Chrome</li><li>Apple Safari</li><li>Other recent-ish WebKit-based browsers</li></ul></p><h3>Platforms supported - debug target</h3><p>The browser with the page you are debugging.<ul><li>Android Browser application</li><li>iOS Mobile Safari application</li><li>PhoneGap/Cordova</li><li>other</li></ul></p><h3>Platforms not supported - debug target</h3><ul><li>iOS 3.1.3 or earlier</li><li>webOS 1.45 or earlier</li></ul><div class=toc>~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~<p><a href=Home.html>Home</a> - <a href=UserInterface.html>User Interface</a> - <a href=Installing.html>Installing</a> - <a href=Running.html>Running</a> - <a href=MultiUser.html>Multi-User</a> - <a href=Security.html>Security</a> - <a href=Building.html>Building</a> - <a href=ChangeLog.html>ChangeLog</a> - <a href=License.html>License</a><br><img src=images/weinre-icon-128x128.png></p></div></body></html>");
