$templateCache.put("docs/node_modules/ng-annotate/node_modules/acorn/test/bench.html","<!doctype html><head><meta charset=utf-8><title>Acorn benchmark</title><script src=../acorn.js></script><script src=compare/esprima.js></script><script src=compare/traceur.js></script><script src=jquery-string.js></script><script src=codemirror-string.js></script><style>\n    td { text-align: right; padding-right: 20px; }\n    th { text-align: left; padding-right: 40px; }\n    body { max-width: 50em; padding: 1em 2em; }\n    h1 { font-size: 150%; }\n  </style></head><h1>Acorn/Esprima/Traceur speed comparison</h1><p>This will run each of the three ES6 parsers on the source code of jQuery 1.11.1 and CodeMirror 3.0b1 for five seconds, and show a table indicating the number of lines parsed per second. Note that Traceur always stores location data, and is thus not fairly compared by the benchmark <em>without</em> location data.</p><p></p><p>Also note that having the developer tools open in Chrome, or Firebug in Firefox <em>heavily</em> influences the numbers you get. In Chrome, the effect even lingers (in the tab) after you close the developer tools. Load in a fresh tab to get (halfway) stable numbers.</p><button onclick=run(false)>Compare <strong>without</strong> location data</button> <button onclick=run(true)>Compare <strong>with</strong> location data</button> <button onclick=\"run(false, true)\">Run only Acorn</button> <span id=running></span><script>\n  var sourceFileName = \'source.js\';\n\n  function runAcorn(code, locations) {\n    acorn.parse(code, {ecmaVersion: 6, locations: locations, sourceFile: sourceFileName});\n  }\n  function runEsprima(code, locations) {\n    esprima.parse(code, {loc: locations, source: sourceFileName});\n  }\n  function runTraceur(code) {\n    var file = new traceur.syntax.SourceFile(sourceFileName, code);\n    var parser = new traceur.syntax.Parser(file);\n    parser.parseScript();\n  }\n\n  var totalLines = codemirror30.split(\"\\n\").length + jquery111.split(\"\\n\").length;\n\n  var nowHost = (typeof performance === \'object\' && \'now\' in performance) ? performance : Date;\n\n  function benchmark(runner, locations) {\n    // Give it a chance to warm up (first runs are usually outliers)\n    runner(jquery111, locations);\n    runner(codemirror30, locations);\n    var t0 = nowHost.now(), t1, lines = 0;\n    for (;;) {\n      runner(jquery111, locations);\n      runner(codemirror30, locations);\n      lines += totalLines;\n      t1 = nowHost.now();\n      if (t1 - t0 > 5000) break;\n    }\n    return lines / ((t1 - t0) / 1000);\n  }\n\n  function showOutput(values) {\n    var html = \"<hr><table>\";\n    for (var i = 0; i < values.length; ++i)\n      html += \"<tr><th>\" + values[i].name + \"</td><td>\" + Math.round(values[i].score) + \" lines per second</td><td>\" +\n                        Math.round(values[i].score * 100 / values[0].score) + \"%</td></tr>\";\n    document.body.appendChild(document.createElement(\"div\")).innerHTML = html;\n  }\n\n  function run(locations, acornOnly) {\n    var running = document.getElementById(\"running\");\n    running.innerHTML = \"Running benchmark...\";\n    var data = [{name: \"Acorn\", runner: runAcorn},\n                {name: \"Esprima\", runner: runEsprima},\n                {name: \"Traceur\", runner: runTraceur}];\n    if (acornOnly) data.length = 1;\n    var pos = 0;\n    function next() {\n      data[pos].score = benchmark(data[pos].runner, locations);\n      if (++pos == data.length) {\n        running.innerHTML = \"\";\n        showOutput(data);\n      } else setTimeout(next, 100);\n    }\n    setTimeout(next, 50);\n  }\n</script>");
